In order to fully visualize how connections are set up, we need to introduce three new socket API calls that will be of importance as we continue this article series. These are connect(), accept() and listen() // Code Snippet 1: Connect() API Call
#include <sys/types.h>
#include <sys/socket.h> int connect(int sockfd, const struct sockaddr *addr, socklen_t addrlen); Connect is responsible for connecting a client with a server that is listening. The clients socket is referenced in the first argument sockfd and it connects to the servers bound address specified in the 2nd argument sockaddr. This is different from bind() as we saw in the previous article, that takes a socket and attaches a local address to it making it available from within the machine, whereas connect() has the ability to attach the address to a remote address that may want to use that socket to communicate. In most cases bind() would be used by a server to make its socket known, and connect() would be used by a client() to connect to the server. The 3rd argument is the addrlen that is simply used to specify the size of the addr (2nd argument) . If a connect() fails, it is good practice for the client to close the socket and attempt a new connection with a new socket.

