It’s time to shift our focus back to Go. We have seen the purpose of the socket() and bind calls(), but the question remains, where and how are they implemented. /**
* Code Snippet 2: Implementations of bind() syscall: Note the similar function signatures.
*/ // This unimplemnted function is found in the syscall/syscall_linx_386.go file and is referenced by the socket function below.
// It is implemented in the syscall/asm_linux_s390x.s file
func rawsocketcall(call int, a0, a1, a2, a3, a4, a5 uintptr) (n int, err Errno) // The bind method mirrors the Unix API for bind calls. A call to rawsocketcall is made (see methods above)
func bind(s int, addr unsafe.Pointer, addrlen _Socklen) (err error) { _, e := socketcall(_BIND, uintptr(s), uintptr(addr), uintptr(addrlen), 0, 0, 0) if e != 0 { err = e } return
} // The socket method mirrors the Unix API for Socket calls. A call to rawsocketcall is made (see method above and below)
func socket(domain int, typ int, proto int) (fd int, err error) { fd, e := rawsocketcall(_SOCKET, uintptr(domain), uintptr(typ), uintptr(proto), 0, 0, 0) if e != 0 { err = e } return
} // func rawsocketcall(call int, a0, a1, a2, a3, a4, a5 uintptr) (n int, err int)
// Kernel interface gets call sub-number and pointer to a0.
// This method is found in the syscall/asm_linux_s390x.s file
TEXT ·rawsocketcall(SB),NOSPLIT,$0-72 MOVD	$SYS_SOCKETCALL, R1	// syscall entry MOVD	call+0(FP), R2 // socket call number MOVD	$a0+8(FP), R3 // pointer to call arguments MOVD	$0, R4 MOVD	$0, R5 MOVD	$0, R6 MOVD	$0, R7 SYSCALL MOVD	$0xfffffffffffff001, R8 CMPUBLT	R2, R8, oksock1 MOVD	$-1, n+56(FP) NEG	R2, R2 MOVD	R2, err+64(FP) RET
oksock1: MOVD	R2, n+56(FP) MOVD	$0, err+64(FP) RET The golang-socket-syscall.go file in Code Snippet 3 above showcases the socket() method with a signature similar to that of the UNIX socket() API. What is even more interesting is that the call to the rawsocketcall() in the socket() refers to a function stub that is actually implemented in Assembly. I wrote an article detailing the importance of Assembly in Go. The Assembly code appears to perform the underlying syscall and passing in relevant arguments received from the Go application, to the kernel. The implementation of bind() is very similar. It also conforms to the bind() in the Unix interface. It also makes a call to rawsocketcall with a _BIND parameter. This is just an integer constant that refers to the integer 2, where _SOCKET refers to 1. Other syscalls have their own unique constant integer identifier.
